import React from 'react';
import logo from "./../../Assets/logo"


function Sidebar() {
    return (
      <div className="sidebar">
        <img src={logo}></img>
        <ul>
            <li>Products</li>
            <li>Users</li>
            <li>Communities</li>
            <li>Notifications</li>
        </ul>
      </div>
    );
  }


export default Sidebar;
